INSERT INTO `sets` VALUES (1,'10E','Tenth Edition','Core','Tenth Edition (10th Edition) is a \'Core Set\' for the collectible trading card game Magic: The Gathering. It was released on July 13, 2007, replacing Ninth Edition as the core set of cards for standard tournament play. The symbol for Tenth Edition is the Roman numeral \'X\'.  As part of their \'Selecting Tenth Edition\' promotion, Wizards of the Coast gave fans the chance to manage a part of the set\'s brand. The results gave the Roman numeral \'X\' over the number \'10\', along with many other card, art, and flavor text choices.\n  Tenth Edition was the first core set since Beta to be printed with black-bordered cards, rather than white-bordered ones. Tenth Edition is also the first core set to include legendary creatures (two of each color), bringing back flavorful relics of Magic\'s past such as Squee, Goblin Nabob, and Kamahl, Pit Fighter','http://en.wikipedia.org/wiki/10th_Edition_(Magic:_The_Gathering)',121,121,121,0,20,'2007-07-13T00:00:00Z','106368,106405,106427,106473,106556,129470,129502,129511,129514,129521,129529,129535,129536,129544,129546,129553,129554,129579,129600,129629,129633,129645,129658,129678,129707,129708,129719,129724,129733,129741,129744,129750,129773,129788,129789,129898,129900,129913,130364,130374,130386,130498,130506,130522,130530,130534,130538,130547,130551,130818,130834,130976,130985,130996,132071,132101,132105,132111,132120,132127,134756,134764,135182,135189,135194,135215,135226,135232,135244,135248,135250,135252,135261,135268,135275,135278,136218,136288,136289,136290,106478,106537,106555,129458,129465,129466,129471,129479,129480,129484,129490,129495,129496,129497,129501,129522,129523,129524,129560,129568,129572,129578,129580,129591,129607,129619,129620,129631,129642,129650,129655,129656,129659,129671,129679,129681,129697,129731,129732,129751,129755,129770,129778,129808,129882,129884,129887,129906,130370,130489,130525,130900,130903,132145,134755,134762,135199,135206,135251,135