he same cards as Beta, though with white borders instead of \n  black, setting the precedent for all successive printings of the basic set, \n  until the 2007 release of Tenth Edition, which returned to black borders.','http://en.wikipedia.org/wiki/Unlimited_(Magic:_The_Gathering)',75,95,117,0,15,'1993-12-01T00:00:00Z','603,611,617,621,623,626,627,629,631,633,642,656,658,661,662,666,670,671,672,676,683,685,689,690,691,692,703,711,715,717,721,722,735,744,748,751,756,761,763,766,768,769,771,772,778,780,786,787,788,799,801,803,804,806,809,810,813,816,819,820,821,824,826,827,832,838,842,850,851,852,855,857,866,605,610,616,630,632,646,668,682,695,741,754,874,877,886,714,598,599,600,601,602,604,606,607,608,609,612,613,614,615,618,619,620,622,624,625,628,634,635,636,637,638,639,640,641,643,644,645,647,648,649,650,651,652,653,654,655,657,659,660,663,664,665,667,669,673,674,675,677,678,679,680,681,684,686,687,688,693,694,696,697,698,699,700,701,702,704,705,706,707,708,709,710,712,713,716,718,719,720,723,724,725,726,727,728,729,730,731,732,733,734,736,737,738,739,740,742,743,745,746,747,749,750,752,753,755,757,758,759,760,762,764,765,767,770,773,774,775,776,777,779,781,782,783,784,785,789,790,791,792,793,794,795,796,797,798,800,802,805,807,808,811,812,814,815,817,818,822,823,825,828,829,830,831,833,834,835,836,837,839,840,841,843,844,845,846,847,848,849,853,854,856,858,859,860,861,862,863,864,865,867,868,869,870,871,872,873,878,879,880,881,882,883,884,885,887,890,893,896,899,786'),(3,'3ED','Revised Edition','Core','The Revised Edition of Magic: The Gathering (also simply known as Revised) was the sixth set and third core set released for the game. Like previous core sets, it had no expansion symbol. Revised Edition cards are white-bordered and generally known for their washed-out look. The set was released in April 1994 and contained 306 cards. It was the first base set to contain cards from black-bordered sets other than Alpha and Beta','http://en.wikipedia.org/wiki/Revised_