languages. It was published in English, French, German, Italian, and as a first for a Magic set in Japanese, traditional Chinese, Korean, Spanish, and Portuguese, which was printed primarily for the Brazilian market. Korean and Chinese Fourth Edition cards have been made only with black borders while Japanese, Portuguese, and Spanish cards exist with white and black borders.','http://en.wikipedia.org/wiki/4th_Edition_(Magic:_The_Gathering)',121,121,121,0,15,'1995-04-01T00:00:00Z','2014,2016,2018,2019,2021,2023,2026,2028,2035,2036,2037,2040,2046,2051,2056,2057,2060,2062,2063,2065,2066,2068,2072,2077,2078,2080,2084,2093,2099,2104,2107,2117,2118,2120,2121,2124,2135,2137,2141,2142,2144,2155,2159,2161,2162,2166,2167,2168,2169,2174,2179,2181,2184,2187,2191,2197,2204,2213,2216,2217,2220,2221,2222,2226,2228,2230,2235,2237,2238,2241,2242,2243,2251,2253,2259,2266,2269,2272,2281,2282,2283,2284,2285,2287,2289,2296,2297,2303,2308,2309,2313,2314,2318,2322,2331,2337,2338,2341,2344,2350,2353,2355,2357,2362,2371,2025,2032,2033,2034,2054,2076,2087,2096,2103,2148,2207,2239,2244,2376,2125,2158,2107,2309,2062,2015,2017,2020,2022,2024,2027,2029,2030,2031,2038,2039,2041,2042,2043,2044,2045,2047,2048,2049,2050,2052,2053,2055,2058,2059,2061,2064,2067,2069,2070,2071,2073,2074,2075,2079,2081,2082,2083,2085,2086,2088,2089,2090,2091,2092,2094,2095,2097,2098,2100,2101,2102,2105,2106,2108,2109,2110,2111,2112,2113,2114,2115,2116,2119,2122,2123,2126,2127,2128,2129,2130,2131,2132,2133,2134,2136,2138,2139,2140,2143,2145,2146,2147,2149,2150,2151,2152,2153,2154,2156,2157,2160,2163,2164,2165,2170,2171,2172,2173,2175,2176,2177,2178,2180,2182,2183,2185,2186,2188,2189,2190,2192,2193,2194,2195,2196,2198,2199,2200,2201,2202,2203,2205,2206,2208,2209,2210,2211,2212,2214,2215,2218,2219,2223,2224,2225,2227,2229,2231,2232,2233,2234,2236,2240,2245,2246,2247,2248,2249,2250,2252,2254,2255,2256,2257,2258,2260,2261,2262,2263,2264,2265,2267,2268,2270,2271,2273,2274,2275,2276,2277,2278,2279,2280,2286,2288,2290,2291,2292,2293,2294,2295,2298,2299,2300,2301,2302,2304,2305,2306,2307,2310,2311,2312,2315,2316,2317,2319,2320,2321,2323,2324,2325,2326,2327,2328,2329,2330,2332,2333,2334,2335,2336,2339,2340,2342,2343,2345,2346,2347,2348,2349,2351,2352,2354,2356,2358,2359,2360,2361,2363,2364,2365,2366,2367,2368,2369,2370,2372,2373,2379,2380,2383,2386,2387,2388,2391,2019,2037,2063,2222,2230'),(5,'5DN','Fifth Dawn','Mirrodin','Fifth Dawn is a Magic: The Gathering expansion set which was released in May 2004. It is the third and final set of the Mirrodin block. There are 165 cards overall, and like the rest of Mirrodin, an unusually large number of them are artifacts. However, Fifth Dawn adds a new twist to artifact theme of Mirrodin and Darksteel: it encourages using colored mana for playing artifact spells, via the Sunburst mechanic (see below). Fifth Dawn \'s expansion symbol is a small image of Helm of Kaldra, a card from this set.\n  Fifth Dawn introduced an enhanced design for artifact cards, which uses a darker inner border to help players distinguish artifacts from white cards. Fifth Dawn theme decks contained a few reprints from Mirrodin and Darksteel with the improved card face.\n  The name Fifth Dawn is derived from the plane\'s five suns. Each sun is associated with a color of mana and the green sun, which has long been absent, returns to the sky as part of this set\'s storyline.','http://en.wikipedia.org/wiki/Fifth_Dawn_(Magic:_The_Gathering)',55,55,55,0,0,'2004-06-04T00:00:00Z','39667,43529,47449,47800,48177,50129,50137,50138,50144,50145,50156,50158,50163,50177,50179,50188,50190,50192,50203,50207,50211,50834,50927,51075,51086,51088,51091,51095,51102,51105,51115,51119,51125,51161,51163,51177,51182,51183,51184,51190,51229,51607,51628,51631,51634,72721,72722,72725,73553,73555,73564,73567,73569,73570,73572,73578,73582,73597,73598,73925,73928,73932,76971,43574,44608,46108,46159,46175,47438,48215,50117,50119,50120,50134,50136,50139,50141,50147,50150,50159,50162,50164,50171,50172,50176,50