 of Magic. It featured cards from Alpha through Urza\'s Saga. The print run was unknown. When it was first printed, Anthologies sold for around $20.00 MSRP, but prices have risen since. As the cards have white borders and standard backs, they are tournament-legal.\n  Unlike Chronicles, an expansion, but like other box sets, such as Battle Royale or Duel Decks: Jace vs. Chandra, the reprinted cards did not count as current product, and thus were only legal in formats which allowed the original cards being reprinted to be used, and were not automatically legal in Standard at the time the product was available','http://en.wikipedia.org/wiki/Anthologies_(Magic:_The_Gathering)',120,0,0,0,0,'1998-11-01T00:00:00Z',''),(18,'ATQ','Antiquities',NULL,'Antiquities was the fifth Magic: The Gathering set and the second expansion set. It was the first set to have an original backstory that explores the mythos of the Magic universe (see Magic: The Gathering storylines). The story is primarily about the brothers Urza and Mishra who are inseparable at first, but become sworn enemies over the finding of two power stones. Trying to get hold of the other\'s stone they eventually lay waste to the whole continent of Terisiare. The set was created by the group of students at the University of Pennsylvania that had helped Richard Garfield design the original game. Mechanically Antiquities revolves around artifacts. Only 35 of the 85 different cards are colored, the remaining 50 cards being artifacts and lands. The expansion symbol for Antiquities was an anvil.','http://en.wikipedia.org/wiki/Antiquities_(Magic:_The_Gathering)',30,44,26,0,0,'1994-03-01T00:00:00Z','993,995,996,998,1000,1003,1005,1006,1007,1009,1013,1017,1019,1023,1024,1026,1030,1036,1037,1038,1039,1042,1046,1047,1050,1055,1056,1059,1061,1066,1067,1075,1025,1041,1058,994,992,997,999,1001,1002,1004,1008,1010,1011,1012,1014,1015,1016,1018,1020,1021,1022,1027,1028,1029,1031,1032,1033,1034,1035,1040,1043,1044,1045,1048,1049,1051,10