 of cards emphasizing the multiplayer aspect of the game. Most of the cards included are ones that can affect multiple opponents. This promotion included cards from all different sets that existed previous to it. The cards still retained their original expansion symbols although they were printed with white borders, which was the standard for reprinted Magic: The Gathering cards of \'core sets\' until the 2007 release of Tenth Edition. These are the only sets that are printed with white borders (which started with Unlimited.) Another interesting aspect is that colored expansions symbols were added to the cards that didn’t have them previously (namely cards from Tempest, Portal: Second Age, Stronghold and Ice Age.)\n  The set included 160 cards built into four different two-color theme decks which are 40 cards each: Spirit Gale (blue / white), Chargoyf (green / red), The Deluge (green / white), and Cinder Heart (black / red).','http://en.wikipedia.org/wiki/Battle_Royale_(Magic:_The_Gathering)',160,0,0,0,0,'1999-11-12T00:00:00Z','21127,15391,21097,21100,21105,21116,21121,21123,21142,21155,21166,21174,21177,21179,21185,21186,21187,21138,21150,21176,11177,11380,21098,21099,21101,21102,21104,21106,21107,21108,21109,21110,21112,21113,21114,21115,21117,21120,21122,21124,21125,21126,21128,21129,21130,21131,21132,21133,21134,21135,21137,21139,21141,21143,21146,21147,21148,21149,21151,21152,21153,21154,21156,21157,21158,21159,21160,21161,21162,21163,21164,21165,21167,21168,21169,21170,21172,21175,21178,21180,21181,21182,21183,21184,21188,21190,21191,21192,21193,21194,21195,21196,21197,21198,21199,21200,21202,21203,21204,21205,22342,22353,22361,22366,22369,15391,21174,21186,21187'),(22,'BTD','Beatdown Box Set',NULL,'Beatdown is a box set for the card game Magic: The Gathering, and the fourth compilation set. It was created for special reprint purposes only and was not legal in Standard at the time of its release. Beatdown was released as a pair of preconstructed decks combined with accessories, unlike the normal distribution of Magic cards in randomized packs. At the time of release it sold for around $30.00 MSRP. Alternate art was done for four cards: Sengir Vampire, Erhnam Djinn, Ball Lightning, and Clockwork Beast. The set is white-bordered, and the expansion symbol is a mace. There are no White cards in the set.','http://en.wikipedia.org/wiki/Beatdown_(Magic:_The_Gathering)',122,0,0,0,0,'2000-12-01T00:00:00Z','26608,26611,26613,26618,26620,26622,26627,26628,26640,26659,26660,26661,27253,27260,27271,26632,26643,27241,27246,26605,26606,26607,26609,26614,26615,26616,26617,26619,26621,26623,26624,26625,26626,26629,26631,26633,26634,26635,26636,26637,26638,26639,26641,26642,26644,26645,26646,26647,26648,26649,26650,26651,26652,26653,26654,26655,26656,26657,26658,27227,27235,27238,27244,27245,27247,27248,27249,27250,27251,27254,27255,27256,27257,27258,27259,27261,27262,27264,27265,27266,27270,27564'),(23,'C13','Commander (2013 Edition)','Commander','Commander is a series of five 100-card, three color Magic: the Gathering decks, meant as a supplement to the variant format initially known as \'Elder Dragon Highlander (EDH)\'. Each deck is based around a legendary creature, called a \'Commander\' or \'General\'. No card other than basic lands appear more than once in each deck, and each deck contains three foil oversized legendary creature cards. This set is notable in that it is the first set printed outside of the normal booster pack expansions to have functionally new cards. There are 51 new cards, made specifically for multi-player games, featured in Commander.','http://en.wikipedia.org/wiki/Commander_(Magic:_The_Gathering)',28,0,0,0,0,'2013-11-01T00:00:00Z',''),(24,'CHK','Champions of Kamigawa','Kamigawa','Champions of Kamigawa (Champions or CHK) is the name of \n  the Magic: The Gathering expansion set released October 1, 2004. The first set\n  of the Kamigawa block, it set the stage for the block\'s story, which was \n  inspired by Japanese myths and revolves around the battle between spirits \n  (kami) and living beings.\n  The set\'s expansion symbol is a torii, the entrance to the Shinto temple. This\n  is especially important, as Kamigawa\'s original idea was summed up as \'Shinto \n  gone horribly wrong\': Kami warring against their human worshippers.','http://en.wikipedia.org/wiki/Champions_of_Kamigawa',110,88,88,0,20,'2004-10-01T00:00:00Z','50228,50233,50247,50254,50262,50268,50272,50285,50299,50300,50301,50305,50311,50313,50315,50319,50320,50338,50342,50349,50408,50414,50426,50432,50437,50438,50439,50440,50441,50445,50449,50451,50459,50474,50484,50509,50510,50512,73907,75248,75258,75265,75277,75278,75291,75302,75305,75334,75357,75367,75381,75401,75402,75403,76634,76637,76639,77136,77138,77139,77143,77919,77921,77922,77926,78184,78192,78586,78600,78602,78608,78681,78683,78684,78686,78688,78693,78694,78695,78853,78964,78965,78966,78976,78984,78989,78991,79084,79090,79098,79105,79112,79113,79119,79121,79125,79133,79145,79149,79152,79166,79168,79176,79177,79198,79201,79204,79205,79217,79218,79230,79231,79233,79244,79252,79253,79857,79863,80242,80243,80245,80250,80254,80255,80256,80275,80278,80280,80281,80282,80284,80285,80290,80410,80413,80414,80508,80511,80522,80524,80525,80527,81702,82423,50219,50236,50256,50261,50288,50291,50292,50293,50296,50321,50343,50345,50346,50385,50394,50400,50405,50412,50413,50433,50442,50487,50488,50499,50514,75241,75254,75259,75285,75286,75319,75328,75353,75366,75404,76636,76638,76641,76652,77140,77924,77925,78606,78690,78691,78697,78854,78855,78963,78972,78979,78981,78987,79063,79066,79068,79069,79070,79080,79088,79115,79132,79144,79151,79155,79158,79159,79179,79188,79191,79196,79199,79214,79215,79223,79229,79236,79242,79247,79862,80241,80246,80251,80273,80274,80276,80291,80415,80417,80500,80520,80523,80532,82000,82001,80526,50299,50349,50439,75357,77138,79133,50253,50308,50318,50367,50383,50431,50461,50469,75247,75262,75267,75268,75269,75399,77920,78190,78590,7