 research into the depths of Ravnica, the eponymous Dragon\'s Maze -- A path that treads all 10 guild gates in order to find and activate an energy source of immense power which is enough to subjugate and control all of the guilds. The Izzet propose a challenge in which each guild selects a champion in order to navigate and conquer the maze and subsequently the other guilds. Each Champion will have to traverse the maze, and they will have to deal with other guilds\' attempts to halt their advance.','http://en.wikipedia.org/wiki/Dragon%27s_Maze',70,40,35,11,0,'2013-05-03T00:00:00Z','368944,368947,368953,368954,368955,368956,368958,368959,368961,368962,368963,368965,368966,368971,368973,368974,368975,368976,368977,368981,368982,368983,368984,368985,368986,368989,368998,368999,369001,369003,369006,369007,369009,369010,369013,369017,369018,369019,369020,369021,369025,369026,369032,369034,369035,369040,369045,369047,369048,369051,369052,369053,369055,369056,369057,369059,369061,369062,369063,369065,369068,369069,369070,369075,369084,369086,369087,369088,369092,369098,368945,368946,368948,368949,368950,368951,368952,368957,368960,368964,368967,368968,368969,368970,368972,368978,368979,368980,368987,368988,368990,368991,368992,368993,368994,368995,368996,368997,369000,369002,369004,369005,369008,369011,369012,369014,369015,369016,369022,369023,369024,369027,369028,369029,369030,369031,369033,369036,369037,369038,369039,369041,369042,369043,369044,369046,369049,369050,369054,369058,369060,369064,369066,369067,369071,369072,369073,369074,369076,369077,369078,369079,369080,369081,369082,369083,369085,369089,369090,369091,369093,369094,369095,369096,369097,369099,368975,369007,368979,368992,368993,369002,368956,369075'),(42,'DIS','Dissension','Ravnica','Dissension is the 60th Magic: The Gathering set, 38th expert level set, and the third and final set in the Ravnica Block, released on May 5, 2006.','http://en.wikipedia.org/wiki/Dissension_(Magic:_The_Gathering)',60,60,60,0,0,'