sion of the stylized Shield of Kaldra.\n  Darksteel featured the powerful single card drawing engine masked as the infamous equipment Skullclamp. When it was eventually banned during block constructed a few months after Darksteel\'s release, Skullclamp was the first to have been banned in block constructed since Mercadian Masques\' Rishadan Port','http://en.wikipedia.org/wiki/Darksteel_(Magic:_The_Gathering)',55,55,55,0,0,'2004-02-06T00:00:00Z','15190,21293,39478,39562,39639,39692,43491,43502,43503,43510,43517,43548,43559,43563,45455,45961,46008,46023,46060,46111,46112,46129,46130,46143,46148,46150,46154,46157,46164,46165,46168,46171,46172,46429,46548,46768,47792,48127,48146,48147,48158,48163,48598,48604,48993,49016,49021,49078,49094,49438,49775,49829,49839,50937,50939,51054,51055,51056,10670,26732,29513,34479,39377,39410,39421,39439,39697,42084,43511,43540,43557,43587,43592,45191,45415,45428,45469,45975,46002,46012,46030,46058,46076,46078,46083,46088,46093,46096,46100,46116,46134,46155,46160,46162,46169,46176,46547,46568,47587,48048,48049,48072,48120,48141,48153,48572,48573,48576,48579,48582,48920,48988,49033,49035,49049,49075,49085,49089,49110,49758,49836,50527,50529,50530,50533,50536,50539,50647,50929,50943,51070,51616,72682,72683,72684,72686,43511,43557,39485,39690,43506,43545,43547,43556,43579,44307,46101,46131,46136,46142,46158,46735,47453,47799,47930,48148,48197,49012,49020,49026,49097,49837,50521,50528,50540,50938,51074,39692,46157'),(49,'EVE','Eventide','Shadowmoor','Eventide is an expansion set, codenamed \"Doughnut\", from the trading card game Magic: The Gathering. It was released on July 25, 2008. The pre-release events for this set were held on July 12–13, 2008.','http://en.wikipedia.org/wiki/Eventide',60,60,60,0,0,'2008-07-25T00:00:00Z','141942,142015,142054,146010,147373,147413,150977,150999,151059,151088,151089,151095,151097,151098,151099,151106,151108,151135,151137,151143,151149,151153,151154,151155,151158,151164,151165,151169,152046,152089,152091,