stinct sets.','http://en.wikipedia.org/wiki/Beta_(Magic:_The_Gathering)',75,95,117,0,10,'1993-10-01T00:00:00Z','296,301,315,319,324,325,328,330,335,340,341,354,356,357,359,360,364,368,369,370,373,374,383,387,388,389,401,402,409,413,419,420,433,442,446,447,449,454,459,461,462,466,468,469,470,471,476,478,484,485,487,495,496,497,501,502,505,508,511,514,517,519,522,524,525,526,527,530,537,552,555,564,303,308,314,344,349,366,393,439,452,472,494,572,575,493,297,298,299,300,302,304,305,306,307,309,310,311,312,313,316,317,318,320,321,322,323,326,327,329,331,332,333,334,336,337,338,339,342,343,345,346,347,348,350,351,352,353,355,358,361,362,363,365,367,371,372,375,376,377,378,379,380,381,382,384,385,386,390,391,392,394,395,396,397,398,399,400,403,404,405,406,407,408,410,411,412,414,415,416,417,418,421,422,423,424,425,426,427,428,429,430,431,432,434,435,436,437,438,440,441,443,444,445,448,450,451,453,455,456,457,458,460,463,464,465,467,473,474,475,477,479,480,481,482,483,486,488,489,490,491,492,498,499,500,503,504,506,507,509,510,512,513,515,516,518,520,521,523,528,529,531,532,533,534,535,536,538,539,540,541,542,543,544,545,546,547,548,549,550,551,553,554,556,557,558,559,560,561,562,563,565,566,567,568,569,570,571,576,577,578,579,580,581,582,583,584,585,588,591,594,597,360,484,525'),(65,'LEG','Legends',NULL,'Legends was the seventh Magic: The Gathering set and the third expansion set, released in June 1994. It was the first expansion set to be sold in packs of 15 (previous expansions had been sold in packs of 8). The set was designed by Wizards of the Coast co-founder Steve Conard and friend Robin Herbert in Canada before the game was initially released.[5] Legends introduces several mechanics and keywords to the game, but the focus of the set lies clearly on the Legends themselves. These were the first multicolored cards in the game. They are also special in that they are all Legendary creatures, meaning that only one of each type can be in play. The expansion symbol for Leg