33698,34222,34229,34250,34368,34378,34384,34390,34467,34470,34782,34819,35072,35923,36432,26279'),(109,'TSH','Time Spiral \"Timeshifted\"','Time Spiral','In the Time Spiral set, timeshifted cards make up a 121-card subset comprised entirely of pre-Mirrodin reprints, tying in with the set\'s theme of revisiting the past. Each card in the subset features the old 7th Edition card frame and has a new purple expansion symbol to denote their unique rarity. One timeshifted card appears in every Time Spiral booster pack, making the cards roughly 50% rarer than rare cards, which also appear once per pack but comprise of only 80 cards. However, in the Time Spiral Preconstructed Decks, timeshifted cards are treated as though they had their original rarity, as each deck features several of the timeshifted cards that were originally common, including multiples of the same card.','http://wiki.mtgsalvation.com/article/Timeshifted',121,0,0,0,0,'2006-10-06T00:00:00Z','106628,106637,106639,106642,106646,107282,108789,108803,108810,108811,108816,108835,108842,108848,108855,108856,108863,108868,108877,108879,108883,108917,108920,108925,108929,109677,109684,109688,109690,109708,109725,109730,109736,109744,109745,109748,109754,109761,106625,106631,106636,106638,106645,106647,106650,106651,106656,106662,106664,106665,107275,107278,107288,107291,107294,107296,107299,107302,108787,108791,108794,108801,108805,108812,108813,108818,108821,108825,108827,108828,108843,108849,108862,108869,108880,108885,108886,108890,108893,108895,108912,108914,108916,108919,108922,108923,108935,109672,109674,109679,109694,109704,109713,109716,109718,109723,109739,109746,109757,109764,108806,108908,107296,107299,108916,108919,108923,108806,106644,107280,107283,108786,108833,108840,108861,108864,108871,108906,108924,108933,109683,109693,109724,109755,109759,111062,126333,106628,108883,108893,109679'),(110,'TSP','Time Spiral','Time Spiral','Time Spiral is a Magic: The Gathering expansion set, released October 6, 2006. The set is laden with references to previous Magic: the Gathering sets. The references are reflected in the card design, which incorporates special rules from older sets, and in the \"Timeshifted\" cards, which are cards reprinted from older sets using the older card design (abandoned three years previous with the 2003 release of Core Set 8th Edition.) The Time Spiral expansion symbol is an hourglass.\n  Time Spiral is the first set in the block of the same name. (A \"block\" consists of three theme-related expansion sets released over a period of a year.) It is followed by Planar Chaos, which deals with alternate timelines and includes many cards reprinted from previous sets but changed in some fundamental way, and Future Sight, which is forward-looking, both in that it includes cards from settings not yet explored in previous sets as well as including game mechanics that did not exist until it came out.\n  As with all Magic: the Gathering sets in this period, Time Spiral is accompanied by a tie-in novel of the same name. Time Spiral, written by Scott McGough, focuses on the efforts of Teferi to deal with the consequences of phasing out Shiv and Zhalfir during the Phyrexian Invasion. This novel was published in September 2006.\n  Time Spiral is typical among the first sets of a Magic: the Gathering block in that the cards are sold in four different forms. Four different theme decks, 60 card decks with themed, fixed composition were released, each featuring a different aspect of the set. Randomized packs, both as the typical 15-card booster packs and the larger 75-card tournament packs','http://en.wikipedia.org/wiki/Time_Spiral',121,80,80,0,20,'2006-10-06T00:00:00Z','106630,106648,106668,108788,108798,108799,108804,108807,108809,108814,108819,108822,108830,108832,108851,108857,108858,108874,108889,108891,108898,108900,108901,108905,108909,108918,109668,109671,109686,109710,109715,109729,109731,109735,109741,109763,110499,110502,110504,110507,110510,110511,110517